import {
  Container,
  BreadcrumbItem,
  Row,
  Col,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Form,
  FormInput,
  FormGroup,
  Collapse,
  Alert,
  Badge
} from "shards-react";
import Head from "next/head";
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect";
import SEO from "react-seo-component";
import QuickSurvey from "../home/QuickSurvey";
import ResourcesLayout from "../resources-components/ResourcesLayout";

// Layout
import Layout from "../components/Layout";
import Img from "react-image";
import Collapsible from "react-collapsible";

// Common
import PDFFile from "../common/PDFFile";

const liStyle = { paddingBottom: "15px" };

var today = new Date();
var dd = String(today.getDate()).padStart(2, "0");
var mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
var yyyy = today.getFullYear();

today = mm + "/" + dd + "/" + yyyy;

class CAPEPapers extends React.Component {
  constructor(props) {
    super(props);

    this.state = { collapse: false };
  }

  render() {
    return (
      <React.Fragment>
        <Layout>
          <SEO
            title={"CXC CAPE Past Papers | CXC Spanish Online"}
            pathname={"https://www.cxcspnish/mailing-list"}
            description={
              "Get free CAPE past papers in preparation for your CXC exams."
            }
            siteLanguage={"en"}
            twitterUsername={"_rxheem"}
            author={"Raheem McDonald"}
            article={true}
            publishedDate={today}
            modifiedDate={today}
          />

          <Container>
            <Breadcrumb>
              <BreadcrumbItem>
                <a href="/">Home</a>
              </BreadcrumbItem>
              <BreadcrumbItem active>CAPE Past Papers</BreadcrumbItem>
            </Breadcrumb>

            <ResourcesLayout></ResourcesLayout>
          </Container>
        </Layout>
      </React.Fragment>
    );
  }
}

export default CAPEPapers;
